function getSign() {
    var message = 'http://spider.wangluozhe.com/challenge/3'
    message = message + '|' + Date.parse(new Date()).toString();
    var key = Date.parse(new Date()).toString();
    sign = encryptByDES(message, key);
    return sign;
}

